import styles from "./styles.module.css";
import React, { useEffect } from 'react';
import { Provider } from 'react-redux';
import store from '.../store/store'; // Ensure this import is correct
import OrderList from '.../components/OrderList';
import TotalOrderValue from '../components/TotalOrderValue';
import { loadOrders } from '../actions/orderActions';


function Home(userDetails) {
	const user = userDetails.user;
	const logout = () => {
		window.open(`${process.env.REACT_APP_API_URL}/auth/logout`, "_self");


		useEffect(() => {
			fetch('/data.json')
			  .then((response) => response.json())
			  .then((data) => {
				store.dispatch(loadOrders(data)); // Directly dispatching action in useEffect
			  });
		  }, []);

	};
	return (
		<div className={styles.container}>
			<h1 className={styles.heading}>Home</h1>

					<button className={styles.btn} onClick={logout}>
						Log Out
					</button>

					<Provider store={store}>
      <div className="container mx-auto px-4 py-8">
        <div className="mb-4">
          <h1 className="text-2xl font-bold">Order Management System</h1>
          <TotalOrderValue />
        </div>
        <OrderList />
      </div>
    </Provider>


		</div>
	);
}

export default Home;






